import { Outlet, Link } from "react-router-dom";
// import Home from './Home'
// import AddMovie from './AddMovie'
// import Homepage from './Homepage'
function Nav(){
	return(
		<>
      <nav>
        <ul>
          <li>
            <Link to="/">Homepage</Link>
          </li>
          <li>
            <Link to="/AddMovie">AddMovie</Link>
          </li>
          <li>
            <Link to="/Home">home</Link>
          </li>
        </ul>
      </nav>

      <Outlet />
    </>
		)
}

export default Nav
